# frozen_string_literal: true

require '../first_uniq_char'
describe FirstUniqueCharacter do
  it 'return first unique char index' do
    expect(subject.first_uniq_char('leetcode')).to eq 0
  end

  it 'returns - 1 if uniqe char doesn\'s exists' do
    expect(subject.first_uniq_char('abccba')).to eq(-1)
  end

  it 'very long string' do
    s = "
    
    
    
    
    
    
    
    "
    expect(subject.first_uniq_char(s)).to eq(5714)
  end
end
